(13, 5, 'Hello', '<p><img src=\"data:image/jpeg;base64,\" width=\"605\" style=\"display: block; margin: auto;\"></p><p><br></p>', 'https://scontent.fhan2-5.fna.fbcdn.net/v/t1.15752-9/317148613_1325253711560506_7042031332465161735_n.png?_nc_cat=107&ccb=1-7&_nc_sid=ae9488&_nc_ohc=kPpGdud764sAX-L-sKQ&tn=9CcJtFlzIttL4SQ0&_nc_ht=scontent.fhan2-5.fna&oh=03_AdRtsfjfCpHEcDVOjSHlL4yQmY1sFyrzXP6yQsxEyYGSQA&oe=63BBB739', '2022-11-11 03:16:42', NULL);
INSERT INTO `posts` (`id`, `author_id`, `title`, `content`, `background_url`, `created_at`, `last_updated_at`) VALUES
(15, 2, 'Understanding Node.js Event-Driven Architecture', '<p>Most of Node‚Äôs objects ‚Äî like HTTP requests, responses, and streams ‚Äî implement the&nbsp;EventEmitter&nbsp;module so they can provide a way to emit and listen to events.</p><p><br></p><p><img src=\"https://cdn-media-1.freecodecamp.org/images/1*74K5OhiYt7WTR0WuVGeNLQ.png\" width=\"342\" style=\"display: block; margin: auto; cursor: nwse-resize;\"></p><p><br></p><p>The simplest form of the event-driven nature is the callback style of some of the popular Node.js functions ‚Äî for example,&nbsp;fs.readFile. In this analogy, the event will be fired once (when Node is ready to call the callback) and the callback acts as the event handler.</p><p>Let‚Äôs explore this basic form first.</p><p><br></p><h4>Call me when you‚Äôre ready, Node!</h4><p>The original way Node handled asynchronous events was with callback. This was a long time ago, before JavaScript had native promises support and the async/await feature.</p><p>Callbacks are basically just functions that you pass to other functions. This is possible in JavaScript because functions are first class objects.</p><p><br></p><p>It‚Äôs important to understand that callbacks do not indicate an asynchronous call in the code. A function can call the callback both synchronously and asynchronously.</p><p>For example, here‚Äôs a host function&nbsp;fileSize&nbsp;that accepts a callback function&nbsp;cb&nbsp;and can invoke that callback function both synchronously and asynchronously based on a condition:</p><pre class=\"ql-syntax\" spellcheck=\"false\"><span class=\"hljs-keyword\">function</span> <span class=\"hljs-title function_\">fileSize</span> (fileName, cb) {\n  <span class=\"hljs-keyword\">if</span> (<span class=\"hljs-keyword\">typeof</span> fileName !== <span class=\"hljs-string\">\'string\'</span>) {\n    <span class=\"hljs-keyword\">return</span> <span class=\"hljs-title function_\">cb</span>(<span class=\"hljs-keyword\">new</span> <span class=\"hljs-title class_\">TypeError</span>(<span class=\"hljs-string\">\'argument should be string\'</span>)); <span class=\"hljs-comment\">// Sync</span>\n  }\n  fs.<span class=\"hljs-title function_\">stat</span>(fileName, <span class=\"hljs-function\">(<span class=\"hljs-params\">err, stats</span>) =&gt;</span> {\n    <span class=\"hljs-keyword\">if</span> (err) { <span class=\"hljs-keyword\">return</span> <span class=\"hljs-title function_\">cb</span>(err); } <span class=\"hljs-comment\">// Asynccb(null, stats.size); // Async</span>\n  });\n}\n</pre><p><br></p><p>Note that this is a bad practice that leads to unexpected errors. Design host functions to consume callback either always synchronously or always asynchronously.</p><p>Let‚Äôs explore a simple example of a typical asynchronous Node function that‚Äôs written with a callback style:</p><pre class=\"ql-syntax\" spellcheck=\"false\"><span class=\"hljs-keyword\">const</span> readFileAsArray = <span class=\"hljs-keyword\">function</span>(<span class=\"hljs-params\">file, cb</span>) {\n  fs.<span class=\"hljs-title function_\">readFile</span>(file, <span class=\"hljs-keyword\">function</span>(<span class=\"hljs-params\">err, data</span>) {\n    <span class=\"hljs-keyword\">if</span> (err) {\n      <span class=\"hljs-keyword\">return</span> <span class=\"hljs-title function_\">cb</span>(err);\n    }\n    <span class=\"hljs-keyword\">const</span> lines = data.<span class=\"hljs-title function_\">toString</span>().<span class=\"hljs-title function_\">trim</span>().<span class=\"hljs-title function_\">split</span>(<span class=\"hljs-string\">\'\\n\'</span>);\n    <span class=\"hljs-title function_\">cb</span>(<span class=\"hljs-literal\">null</span>, lines);\n  });\n};\n</pre><p><br></p><p>readFileAsArray&nbsp;takes a file path and a callback function. It reads the file content, splits it into an array of lines, and calls the callback function with that array.</p><p>Here‚Äôs an example use for it. Assuming that we have the file&nbsp;numbers.txt&nbsp;in the same directory with content like this:</p><pre class=\"ql-syntax\" spellcheck=\"false\">10\n11\n12\n13\n14\n15\n</pre><p><br></p><p>If we have a task to count the odd numbers in that file, we can use&nbsp;readFileAsArray&nbsp;to simplify the code:</p><pre class=\"ql-syntax\" spellcheck=\"false\"><span class=\"hljs-title function_\">readFileAsArray</span>(<span class=\"hljs-string\">\'./numbers.txt\'</span>, <span class=\"hljs-function\">(<span class=\"hljs-params\">err, lines</span>) =&gt;</span> {\n  <span class=\"hljs-keyword\">if</span> (err) <span class=\"hljs-keyword\">throw</span> err;\n  <span class=\"hljs-keyword\">const</span> numbers = lines.<span class=\"hljs-title function_\">map</span>(<span class=\"hljs-title class_\">Number</span>);\n  <span class=\"hljs-keyword\">const</span> oddNumbers = numbers.<span class=\"hljs-title function_\">filter</span>(<span class=\"hljs-function\"><span class=\"hljs-params\">n</span> =&gt;</span> n%<span class=\"hljs-number\">2</span> === <span class=\"hljs-number\">1</span>);\n  <span class=\"hljs-variable language_\">console</span>.<span class=\"hljs-title function_\">log</span>(<span class=\"hljs-string\">\'Odd numbers count:\'</span>, oddNumbers.<span class=\"hljs-property\">length</span>);\n});\n</pre><p><br></p><p>The code reads the numbers content into an array of strings, parses them as numbers, and counts the odd ones.</p><p>Node‚Äôs callback style is used purely here. The callback has an error-first argument&nbsp;err&nbsp;that‚Äôs nullable and we pass the callback as the last argument for the host function. You should always do that in your functions because users will probably assume that. Make the host function receive the callback as its last argument and make the callback expect an error object as its first argument.</p>', 'https://media.licdn.com/dms/image/C5112AQFtkMSuM5oUkg/article-cover_image-shrink_720_1280/0/1582384474532?e=2147483647&v=beta&t=SQmIh43EfsrePliwntpmAplZTlQq07yb-qcjujBDMV8', '2022-11-25 09:48:39', NULL),
(19, 2, '5 best open source platforms for B2B ecommerce', '<pre class=\"ql-syntax\" spellcheck=\"false\">function $initHighlight(block, cls) {\n  try {\n    if (cls.search(/\\bno\\-highlight\\b/) != -1)\n      return process(block, true, 0x0F) +\n             ` class=\"${cls}\"`;\n  } catch (e) {\n    /* handle exception */\n  }\n  for (var i = 0 / 2; i &lt; classes.length; i++) {\n    if (checkCondition(classes[i]) === undefined)\n      console.log(\'undefined\');\n  }\n\n  return (\n    &lt;div&gt;\n      &lt;web-component&gt;{block}&lt;/web-component&gt;\n    &lt;/div&gt;\n  )\n}\n\nexport  $initHighlight;\n</pre><p><br></p>', 'https://res.cloudinary.com/practicaldev/image/fetch/s--yRknV3Rr--/c_imagga_scale,f_auto,fl_progressive,h_420,q_auto,w_1000/https://dev-to-uploads.s3.amazonaws.com/uploads/articles/o8kwbf8lfnq0eqf86yep.jpg', '2022-11-30 21:02:03', NULL);
