(21, 2, 'ChatGPT: Why Everyone Is Obsessed This Mind-Blowing AI Chatbot', '<p><img src=\"data:image/jpeg;base64,\" width=\"166\" style=\"\"></p><pre class=\"ql-syntax\" spellcheck=\"false\"><span class=\"hljs-keyword\">const</span> <span class=\"hljs-title function_\">hello</span> = () =&gt; {\n  <span class=\"hljs-variable language_\">console</span>.<span class=\"hljs-title function_\">log</span>(<span class=\"hljs-string\">\"Hello World\"</span>);  \n}\n</pre><blockquote>The above code is written in JS.</blockquote><p><br></p>', 'https://i.ytimg.com/vi/GqfRKc3YTOY/maxresdefault.jpg', '2022-12-09 00:11:50', NULL);
INSERT INTO `posts` (`id`, `author_id`, `title`, `content`, `background_url`, `created_at`, `last_updated_at`) VALUES
(22, 7, 'Why use NextJS', '<h3><span style=\"color: rgb(255, 220, 0);\">Introduction</span></h3><p>Next.js is an open-source, lightweight and JavaScript framework, which allows you to</p><p>develop fast and user-friendly web applications and static websites using React.</p><p>It is a ReactJS framework for building server-rendered web applications. It includes a number of features out of the box, such as Automatic code splitting, filesystem-based routing, hot code reloading and universal rendering.</p><p><img src=\"https://res.cloudinary.com/practicaldev/image/fetch/s--dWbmgmcw--/c_limit%2Cf_auto%2Cfl_progressive%2Cq_auto%2Cw_880/https://dev-to-uploads.s3.amazonaws.com/uploads/articles/0oqlfzpvx0rkns65juxt.png\" width=\"481\" style=\"display: block; margin: auto;\"></p><p>By framework, we mean Next.js handles the tooling and configuration needed for React, and provides additional structure, features, and optimizations for your application.</p><p>Next.js was created by Guillermo Rauch, a software engineer at Vercel, and is maintained by a team of developers at Vercel. It is an open-source project, and you can find the source code on GitHub.</p><p><br></p><h3><span style=\"color: rgb(255, 220, 0);\">What is Next.js used for?</span></h3><p>Next.JS is best know for building applications such as:</p><ul><li>E-commerce websites</li><li>Blogs</li><li>Portfolio websites</li><li>Documentation websites</li><li>Marketing websites, etc.</li></ul><p><br></p><h3><span style=\"color: rgb(255, 220, 0);\">Difference between Next.js and React.js</span></h3><p>Both Next.js and React are common tools to build a web application. However, there is a clear difference between them, which highly impacts the final choice. Let‚Äôs find out what this difference is and when to choose between Next.js vs React.</p><p>You will discover several benefits and disadvantages of using Next JS and React for React/JavaScript projects if you use them for your development project. These are the crucial front-end development tools, nevertheless, which provide a smooth and enjoyable online development experience. Although both are simple to learn, they have different learning curves.</p><pre class=\"ql-syntax\" spellcheck=\"false\"><span class=\"hljs-keyword\">function</span> <span class=\"hljs-title function_\">HelloNextJs</span>() {\n  <span class=\"hljs-variable language_\">console</span>.<span class=\"hljs-title function_\">log</span>(<span class=\"hljs-string\">\"Hello world\"</span>);\n}\n</pre><p>Have fun coding!!! ‚ú®</p>', 'https://blog.codeminer42.com/wp-content/uploads/2021/02/nextjs-cover.jpg', '2022-12-09 08:48:31', NULL),
(23, 2, 'What is NFT and How Does NFT Work', '<h3><span style=\"color: rgb(255, 220, 0);\">Introduction</span></h3><p>Next.js is an open-source, lightweight and JavaScript framework, which allows you to develop fast and user-friendly web applications and static websites using React.</p><p>It is a ReactJS framework for building server-rendered web applications. It includes a number of features out of the box, such as Automatic code splitting, filesystem-based routing, hot code reloading and universal rendering.</p><p><img src=\"https://res.cloudinary.com/practicaldev/image/fetch/s--dWbmgmcw--/c_limit%2Cf_auto%2Cfl_progressive%2Cq_auto%2Cw_880/https://dev-to-uploads.s3.amazonaws.com/uploads/articles/0oqlfzpvx0rkns65juxt.png\"></p><p>By framework, we mean Next.js handles the tooling and configuration needed for React, and provides additional structure, features, and optimizations for your application.</p><p>Next.js was created by Guillermo Rauch, a software engineer at Vercel, and is maintained by a team of developers at Vercel. It is an open-source project, and you can find the source code on GitHub.</p><h3><span style=\"color: rgb(255, 220, 0);\">Fun Fact‚ú®</span></h3><p>Are you a beginner to ReactJS or NextSJ? I recommend&nbsp;Documatic VScode Extension</p><p>This extension brings&nbsp;Documatic&nbsp;to VSCode: quickly search your large codebases using simple queries - what does it do? what dependencies does it have? And more.</p><p>Documatic search uses AI to link relations between your query and snippets of code, so you don\'t have to know the exact keywords you\'re looking for!</p><h3><span style=\"color: rgb(255, 220, 0);\">What is Next.js used for?</span></h3><p>Next.JS is best know for building applications such as:</p><ul><li>E-commerce websites</li><li>Blogs</li><li>Portfolio websites</li><li>Documentation websites</li><li>Marketing websites, etc.</li></ul><h3><span style=\"color: rgb(255, 220, 0);\">Difference between Next.js and React.js</span></h3><p>Both Next.js and React are common tools to build a web application.</p>', 'https://fsivietnam.com.vn/wp-content/uploads/2022/02/NFT-1.jpg', '2022-12-09 08:51:13', NULL),
(24, 11, 'HelloWorld in many programming languages', '<h3><strong style=\"color: rgb(255, 220, 0);\">C++</strong></h3><pre class=\"ql-syntax\" spellcheck=\"false\"><span class=\"hljs-meta\">#<span class=\"hljs-keyword\">include</span> <span class=\"hljs-string\">&lt;iostream&gt;</span></span>\n<span class=\"hljs-function\"><span class=\"hljs-type\">int</span> <span class=\"hljs-title\">main</span><span class=\"hljs-params\">()</span> </span>{\n  std::cout &lt;&lt; <span class=\"hljs-string\">\"Hello world!!\"</span>;\n}\n</pre><h3><strong style=\"color: rgb(255, 220, 0);\">Javascript</strong></h3><p>...</p>', 'https://learn.microsoft.com/en-us/shows/hello-world/media/helloworld_383x215.png', '2022-12-11 23:56:32', NULL);
