(25, 4, 'When random is not random', '<p><strong style=\"color: rgb(255, 220, 0);\"><em>Some code examples:</em></strong></p><pre class=\"ql-syntax\" spellcheck=\"false\"><span class=\"hljs-comment\">//C++</span>\n<span class=\"hljs-meta\">#<span class=\"hljs-keyword\">include</span> <span class=\"hljs-string\">&lt;iostream&gt;</span></span>\n<span class=\"hljs-function\"><span class=\"hljs-type\">int</span> <span class=\"hljs-title\">main</span><span class=\"hljs-params\">()</span> </span>{\n  std::cout &lt;&lt; <span class=\"hljs-string\">\"Hello World\"</span>;\n}\n<span class=\"hljs-comment\">//Javascript</span>\nconsole.<span class=\"hljs-built_in\">log</span>(<span class=\"hljs-string\">\"Hello\"</span>);\n</pre><p>With an image: <img src=\"data:image/png;base64,\" width=\"603\" style=\"display: block; margin: auto;\"></p><p><br></p><p>etc.</p>', 'https://encrypted-tbn1.gstatic.com/images?q=tbn:ANd9GcSQ9qqC00f0X0Wt7wmwZpx2Mx6BFuPvTBIeS9PFnqvajF3L4hZ7', '2022-12-12 00:15:35', NULL);
